DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_ACTUALIZA IS
        SELECT 
           T2.MIN
           ,CASE
                WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR
                ELSE T1.NUM_DOC END AS NUM_DOC
        FROM <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> T1
        JOIN <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%> T2
        ON (CASE
                WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR ELSE T1.NUM_DOC END = T2.NUM_DOC)
        WHERE BAN_ESTADO_REG = 1
        AND T1.MIN = -1
        AND SK_ESTADO_BENEFI NOT IN (2);

    v_Reg_Actualiza            CUR_ACTUALIZA%ROWTYPE;
    v_Nro_Actualiza            PLS_Integer; 

BEGIN

   OPEN CUR_ACTUALIZA;
   v_Nro_Actualiza := 0;

  LOOP
    FETCH CUR_ACTUALIZA INTO v_Reg_Actualiza;
    EXIT WHEN CUR_ACTUALIZA%NOTFOUND;
    BEGIN  
        IF v_Reg_Actualiza.NUM_DOC IS NOT NULL THEN
            UPDATE <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> T1
               SET  T1.MIN = v_Reg_Actualiza.MIN
                WHERE T1.BAN_ESTADO_REG = 1
                AND CASE
                        WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR ELSE T1.NUM_DOC END = v_Reg_Actualiza.NUM_DOC;
        END IF;
    END;
    COMMIT;
    END LOOP; 
  CLOSE  CUR_ACTUALIZA;   
  COMMIT;
END;

DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_ACTUALIZA IS
        SELECT 
           T2.MIN
           ,CASE
                WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR
                ELSE T1.NUM_DOC END AS NUM_DOC
           ,T3.SK_ETAPA
           FROM <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> T1
           JOIN <%=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB")%> T2
           ON (CASE
                WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR ELSE T1.NUM_DOC END = T2.NUM_DOC)
           LEFT JOIN USER_MT_DB_PR.MINTIC_ESTADO_ETAPA_DIM_TB_T1 T3
           ON (CASE
              WHEN T1.SK_CATEG_BENEF = 1 THEN T1.SK_MUNICIPIO_M ELSE T1.SK_MUNICIPIO END = T3.SK_MUNICIPIO AND T3.ETAPA = T1.META)
           JOIN <%=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB")%> T4
           ON (T3.SK_ETAPA = T4.SK_ETAPA)
           WHERE BAN_ESTADO_REG = 1
           AND T3.SK_ETAPA IS NOT NULL
           AND T1.SK_ETAPA = -1
           AND SK_ESTADO_BENEFI NOT IN (2)
           GROUP BY T2.MIN
           ,CASE
                WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR
                ELSE T1.NUM_DOC END 
           ,T3.SK_ETAPA;

    v_Reg_Actualiza            CUR_ACTUALIZA%ROWTYPE;
    v_Nro_Actualiza            PLS_Integer; 

BEGIN

   OPEN CUR_ACTUALIZA;
   v_Nro_Actualiza := 0;

  LOOP
    FETCH CUR_ACTUALIZA INTO v_Reg_Actualiza;
    EXIT WHEN CUR_ACTUALIZA%NOTFOUND;
    BEGIN  
        IF v_Reg_Actualiza.NUM_DOC IS NOT NULL THEN
            UPDATE <%=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB")%> T1
               SET  T1.SK_ETAPA = v_Reg_Actualiza.SK_ETAPA
                WHERE T1.BAN_ESTADO_REG = 1
                AND CASE
                        WHEN T1.SK_CATEG_BENEF = 1 THEN T1.NUM_IDENT_MENOR ELSE T1.NUM_DOC END = v_Reg_Actualiza.NUM_DOC;
        END IF;
    END;
    COMMIT;
    END LOOP; 
  CLOSE  CUR_ACTUALIZA;   
  COMMIT;
END;

BEGIN
